import React, { useEffect, Suspense, lazy,useState} from 'react'
import { useDispatch, useSelector } from 'react-redux'; 


import './styles/Home.css'
const Cauroselbrand = lazy(() => import('../Component/Caurosel/Cauroselbrand'))
const Footer = lazy(() => import('../Component/Footer/Footer'));
const Homeslider = lazy(() => import('../Component/Homeslider/Homeslider'));
const Home = () => {
    
    const dispatch = useDispatch();
    const city = useSelector(state => state.UserPreference.city)
  
  
    let {selectedCity,selectedpincode,cityList}=useSelector(state=>state.city);
const {mostviewedstores}=useSelector(state=>state.shop);
const {mostviewedproducts}=useSelector(state=>state.product);

    useEffect(() => {
      
     
        dispatch(getmostviewed({"city":selectedCity}));
        dispatch(fetchmostviewed({"city":selectedCity,"pincode":"0"}))

    }, [selectedCity,selectedpincode])

    const offersBrand = useSelector(state => state.Department.department);
    return ( 
        <Suspense fallback={<Loader />} >
           <Header />
          <div className="container-fluid">                                   
                <div className="row">
                    <div className="bannerhome col-lg-12 col-md-12 col-sm-12 col-12">                        
                    
                    </div>
                </div>
            </div>
            <div className="footerhr"></div>
            <Footer />
        </Suspense>
        
    )
}

export default React.memo(Home);


